(658, 89, 'title_1', '[:ru]Завод RusseQuelle был создан в 2010 году благодаря сотрудничеству с Австрийскими\r\nи Итальянскими партнерами.[:en]EN[:]'),
(659, 89, '_title_1', 'field_574c7f8d679fe'),
(660, 89, 'text_1_1', '[:ru]В основу концепции RusseQuelle заложен принцип абсолютной чистоты. Источник имеет историю более 500 лет и находится в уникальном месте России, городе Гороховец, входящем в Золотое Кольцо страны.[:en]EN[:]'),
(661, 89, '_text_1_1', 'field_574c7fad679ff'),
(662, 89, 'text_1_2', '[:ru]В наши дни технология производства заключается лишь в угольной фильтрации воды и абсолютной чистоте на линии розлива. Для обеспечения высокого качества продукции мы используем только экологически чистое сырье немецкого и российского производства.[:en]EN[:]'),
(663, 89, '_text_1_2', 'field_574c7fd367a00'),
(664, 89, 'img_1', '306'),
(665, 89, '_img_1', 'field_574c8022fcea9'),
(666, 89, 'text_1_3', '[:ru]Состав воды RusseQuelle не изменяется искусственно и остаётся полностью натуральным, потому что мы искренне хотим передать вам освежающую искру нашего родника.[:en]EN[:]'),
(667, 89, '_text_1_3', 'field_574c804dfceaa'),
