(675, 89, '_active_3', 'field_574c83dbb4272'),
(676, 89, 'title_3', '[:ru]Наши награды[:en]EN[:]'),
(677, 89, '_title_3', 'field_574c80dbbf6bf'),
(678, 89, 'slider_3', '4'),
(679, 89, '_slider_3', 'field_574c8906d4e85'),
(680, 89, 'slider_2_0_title', '[:ru]Чистая идея[:en]EN[:]'),
(681, 89, '_slider_2_0_title', 'field_574c889364f28'),
(682, 89, 'slider_2_0_text', '[:ru]Подобно великим мастерам, мы трепетно и внимательно относимся ко всему, \r\nчто касается натуральности и качества воды RusseQuelle. Наша цель – заслужить признание каждого, кто хоть однажды попробовал минеральную воду RusseQuelle. [:en]EN[:]'),
(683, 89, '_slider_2_0_text', 'field_574c88a564f29'),
(684, 89, 'slider_2_1_title', '[:ru]Чистая форма[:en]EN[:]'),
(685, 89, '_slider_2_1_title', 'field_574c889364f28'),
(686, 89, 'slider_2_1_text', '[:ru]Тщательно выверенные, совершенные, безупречные и одновременно простые линии, созданные талантливыми людьми - это формы RusseQuelle. RusseQuelle - это союз природы и искусства, появившийся на землях древних Славян. Эти земли славятся своими благодатными, полными полезным микроэлементов, почвами, заливными лугами, нетронутыми человеком лесами. [:en]EN[:]'),
(687, 89, '_slider_2_1_text', 'field_574c88a564f29'),
