(933, 353, 'description', '[:ru]Источник имеет историю более 500 лет и находится в уникальном месте России, городе Гороховец, входящем в Золотое Кольцо страны.[:en]EN[:]'),
(934, 353, '_description', 'field_571506be16882'),
(935, 353, 'content_0_col_0_list', '[:ru]В основу концепции RusseQuelle заложен принцип абсолютной чистоты.\r\nИсточник имеет историю более 500 лет и находится в уникальном месте России, городе Гороховец, входящем в Золотое Кольцо страны.\r\nВ основу концепции RusseQuelle заложен принцип абсолютной чистоты.[:en]EN\r\nEN\r\nEN[:]'),
(936, 353, '_content_0_col_0_list', 'field_57153f105a011'),
(937, 353, 'content_0_col_1_text', '[:ru]Движение – это способ познавать мир вокруг, соединять одни явления с другими и открывать что-то новое. Почему нам так свойственна тяга к движению, какова природа этой страсти? Возможно, этот секрет ещё не раскрыт, как и загадка возникновения нашей Вселенной. Но, с другой стороны, стоит лишь взглянуть на бурный ручей или пробивающийся сквозь землю родник, как становится ясно, что ответ на вопрос «Почему мы так любим движение?» — всегда был у нас перед глазами.[:en]EN[:]'),
