(1036, 8, 'text_3_1', 'В основу концепции RusseQuelle заложен принцип абсолютной чистоты. Источник имеет историю более 500 лет и находится в уникальном месте России, городе Гороховец, входящем в Золотое Кольцо страны.'),
(1037, 8, '_text_3_1', 'field_575b1fac5d444'),
(1038, 8, 'text_3_2', 'В наши дни технология производства заключается в сохранении первозданной натуральности минеральной воды  и абсолютной чистоте на линии розлива.'),
(1039, 8, '_text_3_2', 'field_575b1ff15d445'),
(1040, 8, 'slides_0_table_0_title', '[:ru]Si[:en]EN[:]'),
(1041, 8, '_slides_0_table_0_title', 'field_575b25b945dfd'),
(1042, 8, 'slides_0_table_0_subtitle', '[:ru]Кремний: 5[:en]EN[:]'),
(1043, 8, '_slides_0_table_0_subtitle', 'field_575b25cf45dfe'),
(1044, 8, 'slides_0_table_0_hover_text', '[:ru]Кремний делает кожу, связки и хрящи эластичными. Нейтрализует хлор, радионуклиды, тяжелые металлы.\r\nУлучшает иммунную систему.[:en]EN[:]'),
(1045, 8, '_slides_0_table_0_hover_text', 'field_575b25e545dff'),
(1046, 8, 'slides_0_table', '6'),
(1047, 8, '_slides_0_table', 'field_575b2371290f5'),
(1048, 8, 'slides_0_text', '[:ru]Анализ произведен Испытательной лабораторией минеральных вод Всероссийского научно-исследовательского института пивоваренной, безалкогольной и винодельческой промышленности Российской академии сельскохозяйственных наук.\r\n\r\nВода признана минеральной по составу на основании заключения Федерального государственного учреждения «Российский научный центр восстановительной медицины и курортологии Минздравсоцразвития России» (РНЦ ВМиК).[:en]EN[:]'),
(1049, 8, '_slides_0_text', 'field_575b23c6290f6'),
(1050, 8, 'slides', '1'),
(1051, 8, '_slides', 'field_575b22f3290f4'),
(1052, 8, 'slides_0_table_1_title', '[:ru]pH[:]'),
(1053, 8, '_slides_0_table_1_title', 'field_575b25b945dfd'),
(1054, 8, 'slides_0_table_1_subtitle', '[:ru]pH: 7,4[:]'),
(1055, 8, '_slides_0_table_1_subtitle', 'field_575b25cf45dfe'),
(1056, 8, 'slides_0_table_1_hover_text', '[:ru]Идеальный  кислотно-щелочной баланс. Способствует нормализации\r\nвнутренних процессов организма.[:]'),
(1057, 8, '_slides_0_table_1_hover_text', 'field_575b25e545dff'),
(1058, 8, 'slides_0_table_2_title', '[:ru]ГК[:en]EN[:]'),
(1059, 8, '_slides_0_table_2_title', 'field_575b25b945dfd'),
(1060, 8, 'slides_0_table_2_subtitle', '[:ru]>2[:en]EN[:]'),
(1061, 8, '_slides_0_table_2_subtitle', 'field_575b25cf45dfe'),
(1062, 8, 'slides_0_table_2_hover_text', '[:ru]Гуминовые кислоты - мощный антиоксидант, выводят тяжелые металлы, улучшает работу печени, обладают антибактериальными\r\nсвойствами, улучшают кишечную микрофлору. Удаляют диарею, другие расстройства пищеварения. Выводят аллергены из организма.[:en]EN[:]'),
(1063, 8, '_slides_0_table_2_hover_text', 'field_575b25e545dff'),
(1064, 8, 'slides_0_table_3_title', '[:ru]Na[:en]EN[:]'),
(1065, 8, '_slides_0_table_3_title', 'field_575b25b945dfd'),
(1066, 8, 'slides_0_table_3_subtitle', '[:ru]Натрий: 10[:en]EN[:]'),
(1067, 8, '_slides_0_table_3_subtitle', 'field_575b25cf45dfe'),
(1068, 8, 'slides_0_table_3_hover_text', '[:ru]Основная задача натрия – поддержание водно-солевого баланса в клетках человека. Натрий нормализует нервно-мышечную деятельность и функции почек.[:en]EN[:]'),
(1069, 8, '_slides_0_table_3_hover_text', 'field_575b25e545dff'),
(1070, 8, 'slides_0_table_4_title', '[:ru]Mg[:en]EN[:]'),
(1071, 8, '_slides_0_table_4_title', 'field_575b25b945dfd'),
(1072, 8, 'slides_0_table_4_subtitle', '[:ru]Магний: 30[:en]EN[:]'),
(1073, 8, '_slides_0_table_4_subtitle', 'field_575b25cf45dfe'),
(1074, 8, 'slides_0_table_4_hover_text', '[:ru]Магний снимает стресс и уменьшает тягу к сладкому. Именно поэтому его иногда называют антистрессовым веществом. Он расслабляет мышцы, улучшает сон, снимает напряжение.[:en]EN[:]'),
(1075, 8, '_slides_0_table_4_hover_text', 'field_575b25e545dff'),
(1076, 8, 'slides_0_table_5_title', '[:ru]Se[:]'),
